import  {RiHome2Fill,RiHome2Line} from 'react-icons/ri';
import React from 'react';
import {IoSearchOutline} from 'react-icons/io';
import {BiLibrary} from 'react-icons/bi;'

const HomeIcon = ()=>{
    return <RiHome2Line/>
}


const HomeIconFill = ()=>{
    return <RiHome2Fill/>
}  

const SearchIcon = ()=>{
    return <IoSearchOutline/>
}

const LibraryIcon = ()=>{
    return <BiLibrary/>
}
export default LibraryIcon
